import React from "react";

function Lines ({group}) {

    var larges = []


    const largeOrSmall = () => {
        if (group === "Larges") {
            for (let i = 0; i < 7; i++) {
                larges.push(<li><input type="checkbox" />{i}</li>)
                console.log(larges)
            }
        }
    }
   

    return (
        <div>
            <ul className="lines">{largeOrSmall}</ul>
        </div>
    )
}

export default Lines
